import React from 'react';
import './App.css';
import Nav from './Nav';
import Lobby from './Lobby';
import Login from './Login';
import {BrowserRouter as Rounter, Switch, Route} from 'react-router-dom'

function App() {
  return (
    <Rounter>
      <div className="App">
        <Nav/>
        <Route path="/lobby" compnonet={Lobby}/>
        <Route path="/login" compnonet={Login}/>
      </div>  
    </Rounter>
  );
}

export default App;
